// beat 91%.
class Solution_01 {
 public:
  string convert(const string s, const int numRows) {
    if (numRows == 1) return s;
    string rtn;
    rtn.reserve(s.size());
    int iteration_count = 0;
    while ((iteration_count * (numRows * 2 - 2)) < s.size()) {
      rtn.push_back(s[iteration_count * (numRows * 2 - 2)]);
      ++iteration_count;
    }

    for (int i = 1; i < numRows - 1; ++i) {
      iteration_count = 0;
      while ((i + iteration_count * (numRows * 2 - 2)) < s.size() || (numRows * 2 - 2 - i + iteration_count * (numRows * 2 - 2)) < s.size()) {
        if ((i + iteration_count * (numRows * 2 - 2)) < s.size())
          rtn.push_back(s[i + iteration_count * (numRows * 2 - 2)]);
        if ((numRows * 2 - 2 - i + iteration_count * (numRows * 2 - 2)) < s.size())
          rtn.push_back(s[numRows * 2 - 2 - i + iteration_count * (numRows * 2 - 2)]);
        ++iteration_count;
      }
    }

    iteration_count = 0;
    while ((numRows - 1 + iteration_count * (numRows * 2 - 2)) < s.size()) {
      rtn.push_back(s[numRows - 1 + iteration_count * (numRows * 2 - 2)]);
      ++iteration_count;
    }
    return rtn;
  }
};

